INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (1, "リン", 0, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 1, 24, "2020/04/30 12:00:00", 24001, "あたしだって\nやるときはやるよ！");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (1, "リン", 1, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 1, 24, "2020/04/30 12:00:00", 24002, "ふぅ…\nこれであたしの仕事は\n終わりだね");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (1, "リン", 2, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 1, 24, "2020/04/30 12:00:00", 24003, "終わった終わった\n一人でもなんとか\nなるもんだね");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (2, "リン", 3, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 2, 24, "2020/04/30 12:00:00", 24004, "やったね！\nこれでようやく\nサボれるよ…");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (1, "リン", 4, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 1, 24, "2020/04/30 12:00:00", 24005, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (2, "リン", 5, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 2, 24, "2020/04/30 12:00:00", 24006, "あたしを敵に回した\n恐ろしさ\n思い知ったか！");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (2, "リン", 6, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 2, 24, "2020/04/30 12:00:00", 24007, "あたしも意外と\nやるもんでしょ？");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (4, "リン", 7, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 4, 24, "2020/04/30 12:00:00", 24008, "疲れた…\nねずみの逃げ足\n速すぎるよ…");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (4, "リン", 8, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 4, 24, "2020/04/30 12:00:00", 24009, "このままじゃ\nまっひ～に\n叱られちゃうよ");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (4, "リン", 9, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 4, 24, "2020/04/30 12:00:00", 24010, "まじめに\nやったんだけどな…\n悔しいな～");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (4, "リン", 10, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 4, 24, "2020/04/30 12:00:00", 24011, "やられた…\nねずみって意外と\nてごわいね");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (4, "リン", 11, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 0.0, 4, 24, "2020/04/30 12:00:00", 24012, "おのれ～\nあたしのチーズを\n盗みやがって～！");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (4, "リン", 12, "2030/12/17 14:59:59", 0.0, 0.0, 102601, 10040, 1.81, 1, 24, "2020/04/30 12:00:00", 24013, "疲れた…\nけど、次こそは\n守り抜くよ…");
